DELIMITER $$
--
-- Functions
--
CREATE DEFINER=`root`@`localhost` FUNCTION `MovePatternToDosage` (`pattern` TEXT) RETURNS INT(11)  BEGIN
    -- Update the table to handle the input pattern
    UPDATE med_data
    SET 
        generic_dosage = CONCAT_WS(' ', generic_dosage, REGEXP_SUBSTR(generic_name, pattern)),
        generic_name = TRIM(REGEXP_REPLACE(generic_name, pattern, ''))
    WHERE generic_name REGEXP pattern;

    -- Return the number of affected rows
    RETURN ROW_COUNT();
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `MovePatternToDosageTesting` (`pattern` TEXT) RETURNS INT(11)  BEGIN
    -- Update the table to handle the input pattern
    UPDATE testing
    SET 
        generic_dosage = CONCAT_WS(' ', generic_dosage, REGEXP_SUBSTR(generic_name, pattern)),
        generic_name = TRIM(REGEXP_REPLACE(generic_name, pattern, ''))
    WHERE generic_name REGEXP pattern;

    -- Return the number of affected rows
    RETURN ROW_COUNT();
END$$

DELIMITER ;

